const repoApiUrl="https://api.github.com/repos/LimeWebb/emojis/contents/";async function getEmojiSet(e="lime1111"){try{var t=await(await fetch(""+repoApiUrl+e)).json().filter(e=>"file"===e.type);return t?Array.isArray(t)?t.map(e=>({name:e.name.replace(/(\.png)$/,""),url:e.download_url??null})):[]:[]}catch(e){return console.error(e),[]}}async function getEmojiByName(e="lime1111_dizzy"){const t=e.split("_");return(await getEmojiSet(t[0])).find(e=>e.name==t[1])?.url??""}export{repoApiUrl,getEmojiSet,getEmojiByName};